var today = new Date()
var curHr = today.getHours()
let msg =""
if (curHr < 12) {
  console.log('good morning')
  msg="good morning"
} else if (curHr < 18) {
  console.log('good afternoon')
  msg="good sfetrnoon"
} else {
  console.log('good evening')
}

